import React, { useState } from 'react';
import { Card, ListGroup, Form } from 'react-bootstrap';

function Curriculum() {
  // Estado para armazenar o tipo de formação selecionado
  const [selectedFormation, setSelectedFormation] = useState('');

  // Função para atualizar o estado com o valor selecionado
  const handleFormationChange = (event) => {
    setSelectedFormation(event.target.value);
  };

  return (
    <div className="mt-5 pt-5">
      <Card>
        <Card.Header as="h5">IDENTIFICAÇÃO</Card.Header>
        <ListGroup variant="flush">
          <ListGroup.Item><strong>Nome:</strong> O Sábio Senhor das Galáxias</ListGroup.Item>
          <ListGroup.Item><strong>Telefone:</strong> (12) 9 1234-5678 <a href="https://wa.me/121912345678" target="_blank" rel="noopener noreferrer">WhatsApp</a></ListGroup.Item>
          <ListGroup.Item><strong>Endereço:</strong> Rua da Saudade, nº 123, Bairro do Sorriso, CEP, Cidade da Luz-PE</ListGroup.Item>
        </ListGroup>

        <Card.Header as="h5">FORMAÇÃO</Card.Header>
        <ListGroup variant="flush">
          {/* Campo para escolher o tipo de formação */}
          <ListGroup.Item>
            <strong>Tipo de Formação:</strong>
            <Form.Control
              as="select"
              value={selectedFormation}
              onChange={handleFormationChange}
            >
              <option value="">Selecione</option>
              <option value="Graduacao">Graduação</option>
              <option value="PosGraduacao">Pós-Graduação</option>
              <option value="Tecnico">Técnico</option>
            </Form.Control>
          </ListGroup.Item>

          {/* Exibe os detalhes da formação com base na seleção do usuário */}
          {selectedFormation === 'Graduacao' && (
            <ListGroup.Item><strong>GRADUAÇÃO:</strong> 2019 – CIÊNCIA DA COMPUTAÇÃO - TreinaRec</ListGroup.Item>
          )}
          {selectedFormation === 'PosGraduacao' && (
            <>
              <ListGroup.Item><strong>PÓS-GRADUAÇÃO:</strong> 2023 – Banco de dados – Mestrado – TreinaRec</ListGroup.Item>
              <ListGroup.Item><strong>PÓS-GRADUAÇÃO:</strong> 2024 – Spring API – Especialista – TreinaRec</ListGroup.Item>
            </>
          )}
          {selectedFormation === 'Tecnico' && (
            <ListGroup.Item><strong>TÉCNICO:</strong> 2012 – Eletrônica Básica - IFPE</ListGroup.Item>
          )}
        </ListGroup>

        <Card.Header as="h5">EXPERIÊNCIA</Card.Header>
        <ListGroup variant="flush">
          <ListGroup.Item>Empresa B – 04/2024 a atual</ListGroup.Item>
          <ListGroup.Item>Empresa A – 01/2022 a 03/2024</ListGroup.Item>
        </ListGroup>

        <Card.Header as="h5">INFORMAÇÕES ADICIONAIS</Card.Header>
        <ListGroup variant="flush">
          <ListGroup.Item><a href="https://facebook.com/eu" target="_blank" rel="noopener noreferrer">Facebook</a></ListGroup.Item>
          <ListGroup.Item><a href="https://linkedin.com/in/eu" target="_blank" rel="noopener noreferrer">LinkedIn</a></ListGroup.Item>
        </ListGroup>
      </Card>
    </div>
  );
}

export default Curriculum;
